import React from "react";
import "./Navigation.css";

const Navigation = ({ onRouteChange }) => {
  return (
    <div>
      <p className="f3 link dim black underline pa3 pointer content" onClick={onRouteChange}>
        Sign Out
      </p>
    </div>
  );
};

export default Navigation;
